import React from 'react';
import {useSrate} from 'react';
import MySlider from './MySlider';

function MyRGBPanel(){
    return(
    <>
        <MySlider color="RED" />
        <MySlider color="GREEN"/>
        <MySlider color="BLUE"/>
    </>
    );
}
